import React from 'react';
import "./Contact.css"
import logo from "../../images/CandyLand_Logo_Blue.png";

function Contact() {
    return (
        <div className= "contact-container">
            <div className="contact-content">
                <h2 className="contact-header">Contact Us</h2>
                <p className="contact-paragraph"> Address: Ur moms house</p>
                <p className="contact-paragraph">Phone: 69</p>
                <p className="contact-paragraph">yuhhhh@gmail.com</p>
                <div className="contact-logo">
                    <img className="logo" src={logo} alt="CandyLand Logo"/>
                </div>
            </div>
        </div>
    );
}

export default Contact;
